import { BrowserRouter, Outlet, Route, Routes , Navigate } from 'react-router-dom';
import './App.css'
import { useState } from 'react';
// Dataprovider
import DataProvider from './Context/Dataprovider';

// Components
import Login from './component/account/login';
import Header from './component/Header/header';
import Home from './component/Home/home';

const privateRoute = ({ isuserAutenticated , ...props }) =>
{
  return isuserAutenticated ?
    <>
      <Outlet />
    </>
    :
    <Navigate replace to = '/login' />
}
function App() {
  const [isuserAuthenticated , setUserAutenticated] = useState(false)
  return (
    <DataProvider>
      <BrowserRouter>
        {<Header />}
        <div className="App">
          <Routes>
            <Route
              path="Login"
              element={<Login setuserAutenticated={setuserAutenticated} />}
            />
            <Route path="/" element={ <privateRoute isuserAuthenticated = { isuserAuthenticated } />}>
              <Route path="/" element={<Home />} />
            </Route>
          </Routes>
        </div>
      </BrowserRouter>
    </DataProvider>
  );
}

export default App;
